    <li className="list-group-item">Age: {Profile.age}</li>
    <li className="list-group-item">Instrument: {Profile.instrument}</li>
    <li className="list-group-item">Style: {Profile.style}</li>
    <li className="list-group-item">Experience: {Profile.experience}</li>
  </ul>
  <div className="card-body">
  <br />
  <br />


        {/*!props.image && <i className="fa fa-spinner fa-spin" aria-hidden="true" />*/}
  </div>
  <CardBtn

        onClick={props.handleBtnClick}
        data-value="pass"
      />
   <CardBtn

        onClick={props.handleBtnClick}
        data-value="pick"
      />
</div>



  );
}

export default Card;
